import React from 'react';

export default class Logcr extends React.Component {
  render() {
    return (
      <div className='logcr'>
        <div className='email'>
          <h2>
            <b> email</b>
          </h2>
        </div>
        <div className='password'>
          <h2>
            <b>password</b>
          </h2>
        </div>
      </div>
    );
  }
}
